import "./EspenseItem.css";

function EspenseItem() {
  return (
    <div className="expense-item">
      <div>07 marh 2023</div>
      <div expense-item_description>
        <h2>{expenseTitle}</h2>
        <div className="expense-item_price">$289.21</div>
      </div>
    </div>
  );
}
export default EspenseItem;
